import React from "react";

const ContentApiDetails = ({ TotalPositive, TotalDeath, TotalRecovered }) => {
  return (
    <div>
      <ul>
        <li>{TotalPositive}</li>
        <li>{TotalDeath}</li>
        <li>{TotalRecovered}</li>
      </ul>
    </div>
  );
};

export default ContentApiDetails;
